import React, { useState } from "react";
import { Formik, Form, Field } from "formik";
import { useNavigate, useLocation } from "react-router-dom";
import axios from "axios";
import * as Yup from "yup";
import { Link } from "react-router-dom";

function Create_user() {
  const errors = [];
  const user_data = JSON.parse(localStorage.getItem("user_data"));
  const [user, setuser] = useState({
    tracenet_username: "",
    tracenet_password: "",
    user: user_data.id,
  });

  const initialValues = {
    tracenet_username: "",
    tracenet_password: "",
    user: user_data.id,
  };

  const navigate = useNavigate();
  const validationSchema = Yup.object({
    tracenet_username: Yup.string().required("*Email is required"),
    tracenet_password: Yup.string().required("*Password is required"),
  });

  const handleChange = (e) => {
    var { name, value } = e.target;
    setuser((prevState) => ({ ...prevState, [name]: value }));
  };

  const handleSubmit = (event) => {
    const form = event.currentTarget;
    event.preventDefault();
    axios
      .post("http://localhost:8000/tracenet_user/", user, {
        headers: {
          "Content-Type": "application/json",
          Authorization: `Token ${user_data.key}`,
        },
      })
      .then((res) => {
        localStorage.setItem(
          "user_data",
          JSON.stringify({ ...user_data, tracenet_data: res.data })
        );
        navigate("/dashboard/user-detail");
      })
      .catch((err) => {
        Object.values(err.response.data).map((data) => {
          errors.push(data);
        });
        alert(errors);
      });
  };

  return (
    <div className="content-wrapper">
      <Formik
        initialValues={initialValues}
        validationSchema={validationSchema}
        onSubmit={(values, { resetForm }) => {
          axios
            .post("http://localhost:8000/tracenet_user/", values, {
              headers: {
                "Content-Type": "application/json",
                Authorization: `Token ${user_data.key}`,
              },
            })
            .then((res) => {
              localStorage.setItem(
                "user_data",
                JSON.stringify({ ...user_data, tracenet_data: res.data })
              );
              navigate("/dashboard/user-detail");
            })
            .catch((err) => {
              Object.values(err.response.data).map((data) => {
                errors.push(data);
              });
            });
          alert(errors);
          resetForm(initialValues);
        }}
      >
        {({ errors, touched }) => (
          <div className="user-card col-md-6 offset-md-3">
            <div className="card card-dark">
              <div className="card-header">
                <h3 className="card-title">Create Tracenet User</h3>
              </div>
            <Form>
              <div className="card-body">
              <div className="form-group">
                <label htmlFor="exampleInputEmail1">Tracenet User name</label>
                <input
                  type="text"
                  className="form-control"
                  id="exampleInputEmail1"
                  name="tracenet_username"
                  placeholder="Enter email"
                  onChange={handleChange}
                />
              </div>
                <div className="form-group">
                  <label htmlFor="exampleInputTracentUser">Tracenet User name</label>
                  <Field
                    name="tracenet_username"
                    className="form-control"
                    placeholder="Enter Username"
                    value={user_data ? user_data.email : null}
                  />
                  {errors.email && touched.email ? (
                    <div>{errors.email}</div>
                  ) : null}
                </div>
                <div className="form-group">
                  <label htmlFor="exampleInputPassword1">Password</label>
                  <Field
                    name="password"
                    className="form-control"
                    placeholder="Password"
                    type="password"
                  />
                  {errors.password && touched.password ? (
                    <div>{errors.password}</div>
                  ) : null}
                </div>

                <div className="form-check">
                  <input
                    type="checkbox"
                    className="form-check-input"
                    id="exampleCheck1"
                  />
                  <label className="form-check-label" htmlFor="exampleCheck1">
                    Remember Me
                  </label>
                </div>
              </div>
              <div className="card-footer">
                <button type="submit" className="btn btn-secondary btn-block">
                  Login
                </button>
                <br />
                <p className="register offset-md-4">
                  Not a Member ?{" "}
                  <a href="#">
                    <Link to="/reg">Register</Link>
                  </a>
                </p>
              </div>
            </Form>
          </div>
          </div>
        )}
      </Formik>

      {/* <div className="user-card col-md-6 offset-md-3">
        <div className="card card-dark">
          <div className="card-header">
            <h3 className="card-title">Create Tracenet User</h3>
          </div>
          <form onSubmit={handleSubmit}>
            <div className="card-body">
              <div className="form-group">
                <label htmlFor="exampleInputEmail1">Tracenet User name</label>
                <input
                  type="text"
                  className="form-control"
                  id="exampleInputEmail1"
                  name="tracenet_username"
                  placeholder="Enter email"
                  onChange={handleChange}
                />
              </div>
              <div className="form-group">
                <label htmlFor="exampleInputPassword1">Tracenet Password</label>
                <input
                  type="password"
                  className="form-control"
                  id="exampleInputPassword1"
                  name="tracenet_password"
                  placeholder="Password"
                  onChange={handleChange}
                />
              </div>

              <div className="form-check">
                <input
                  type="checkbox"
                  className="form-check-input"
                  id="exampleCheck1"
                />
                <label className="form-check-label" htmlFor="exampleCheck1">
                  Check me out
                </label>
              </div>
            </div>
            <div className="card-footer">
              <button type="submit" className="btn btn-primary">
                Submit
              </button>
            </div>
          </form>
        </div>
      </div> */}
    </div>
  );
}

export default Create_user;
